const ImageGallery = ({ images }) => {
    console.log({ images })
    return (

        <ul className="ImageGallery">
            {images.map(({ webformatURL, id, tag }) =>
                <li key={id}>
                    <a href="">
                        <img src={webformatURL} alt="photo" />
                    </a>
                </li>
            )}

        </ul>
    )

}

export default ImageGallery;
